import React from 'react';

//import data
import {navData} from '../data';

const Nav = () => {
  return (
  <nav>
    <ul className='flex gap-x-8'>
      {navData.map((item, index)=>{
        return <li className='border-b-2 border-transparent hover:border-blue transition' 
          key={index}>
          <a href={item.href}>{item.name}</a>
          </li>
      })}
    </ul>
  </nav>
  );
};

export default Nav;
